addpath('Projekt 1/scripts')
addpath('Projekt 1/functions')
addpath('Projekt 1')

close all;

fig_folder = fullfile('wykresy', 'task_2');
if ~exist(fig_folder, 'dir')
    mkdir(fig_folder);
end
%[text] Parametry
C1 = 0.62;
C2 = 0.71;
alpha1 = 19;
alpha2 = 37;

F1pp = 240;
Fdpp = 140;
tau = 175;

h1pp = 1/alpha1^2*(F1pp+Fdpp)^2 %[output:5faec9da]
h2pp = alpha1^2/alpha2^2*h1pp %[output:81a9b547]

F1min = 40;


num_local = 5;
use_u = true;

Ts = 35; % Must be a divisor of tau

modify_mfs = true; % Only whe n num_local = 5
test_feedforward = false;
use_feedforward = false;

%[text] Wyliczenie h2\_min i h2\_max dla założonych F1max i F1min. Z modelu wynika, że, przy stałym Fd, większe F1 skutkuje większym h2.
h1max = 1/alpha1^2*(F1max+Fdpp)^2 %[output:07b48b4b]
h2max = alpha1^2/alpha2^2*h1max %[output:7f390167]

if ~test_feedforward
    use_feedforward = false;
end



%[text] Obliczanie parametrów modeli lokalnych
sample_us = linspace(F1min, F1max, num_local) %[output:94f03398]
sample_ys = linspace(1, h2max, num_local) %[output:1166911e]

Ads = [];
Bds = [];
Eds = [];
h1bars = [];
h2bars = [];
F1bars = [];
Fdbars = [];

for i = 1:num_local
    if use_u
        [Ad, Bd, Ed, h1bar, h2bar, F1bar, Fdbar] = f_disc_lin(C1, C2, alpha1, alpha2, sample_us(i), Fdpp, Ts, true);
    else
        [Ad, Bd, Ed, h1bar, h2bar, F1bar, Fdbar] = f_disc_lin(C1, C2, alpha1, alpha2, sample_ys(i), Fdpp, Ts, false);
    end
    Ads = [Ads; Ad];
    Bds = [Bds; Bd];
    Eds = [Eds; Ed];
    h1bars = [h1bars; h1bar];
    h2bars = [h2bars; h2bar];
    F1bars = [F1bars; F1bar];
    Fdbars = [Fdbars; Fdbar];
end
%[text] Funckje przynależności
to_plot = true;
mf_type = "gbellmf"; % or "trimf", "trapmf", "gbellmf"
membership_functions %[output:8e0205fd] %[output:4147f370] %[output:68e16fcf] %[output:6e08a8ca] %[output:6d94eb12] %[output:501a3262]
exportgraphics(gcf, fullfile(fig_folder, ['memb_func_' num2str(num_local) '.pdf'])); %[output:501a3262]


%[text] Symulacja modelu rozmytego (h1 - wyjście modelu nieliniowego wyliczone w zadanie1.m)
h1_fuzzy = ones(1, kk)*h1pp;
h2_fuzzy = ones(1, kk)*h2pp;
F1_fuzzy = F1;
Fd_fuzzy = Fd;
for k = k_tau+2:kk
    % Wyliczanie przynależności
    mu = evalmf(mfs, ~use_u * h2_fuzzy(k) + use_u * F1_fuzzy(k - 1))/sum(evalmf(mfs, ~use_u * h2_fuzzy(k) + use_u * F1_fuzzy(k - 1)));
    
    % Wyliczanie A, B, E jako ważone średnie macierzy lokalnych
    A = zeros(2,2);
    B = zeros(2,1);
    E = zeros(2,1);
    x_next = zeros(2,1);
    for i = 1:num_local
        A = Ads((i-1)*2+1:i*2, :);
        B = Bds((i-1)*2+1:i*2, :);
        E = Eds((i-1)*2+1:i*2, :);
        x_fuzzy = [h1_fuzzy(k-1) - h1bars(i); h2_fuzzy(k-1) - h2bars(i)];
        u_fuzzy = F1_fuzzy(k-1-k_tau) - F1bars(i);
        d_fuzzy = Fd_fuzzy(k-1) - Fdbars(i);
        x_fuzzy_new = (A*x_fuzzy + B*u_fuzzy + E*d_fuzzy);
        x_next_loc = x_fuzzy_new + [h1bars(i); h2bars(i)];
        x_next = x_next + mu(i)*x_next_loc;
    end
    h1_fuzzy(k) = max(x_next(1), 0);
    h2_fuzzy(k) = max(x_next(2), 0);
end

n_common = min(length(h2), length(h2_fuzzy));
err = h2(1:n_common) - h2_fuzzy(1:n_common);
rmse_h2 = sqrt(mean(err.^2));

figure; %[output:082e9dfa]
stairs(h2_fuzzy, 'DisplayName', 'Fuzzy'); %[output:082e9dfa]
hold on; %[output:082e9dfa]
stairs(h2, 'DisplayName', 'Nonlinear'); %[output:082e9dfa]
grid on; xlabel('t [s]'); ylabel('h2 [cm]'); %[output:082e9dfa]
legend('Location','best'); title('Porównanie modelu nieliniowego i rozmytego - h2'); %[output:082e9dfa]
exportgraphics(gcf, fullfile(fig_folder, ['fuzzy_h2_' num2str(num_local) 'useu' num2str(use_u) '.pdf']), 'ContentType', 'vector'); %[output:082e9dfa]

figure; %[output:30cb330f]
stairs(h1_fuzzy, 'DisplayName', 'Fuzzy'); %[output:30cb330f]
hold on; %[output:30cb330f]
stairs(h1, 'DisplayName', 'Nonlinear'); %[output:30cb330f]
grid on; xlabel('t [s]'); ylabel('h1 [cm]'); %[output:30cb330f]
legend('Location','best'); title('Porównanie modelu nieliniowego i rozmytego - h1'); %[output:30cb330f]
exportgraphics(gcf, fullfile(fig_folder, ['fuzzy_h1_' num2str(num_local) 'useu' num2str(use_u) '.pdf']), 'ContentType', 'vector'); %[output:30cb330f]

%[text] Budowa macierzy lokalnych regulatorów DMC (Rozmywamy po wejściu)
if ~use_u
    disp("CHANGE use_u TO TRUE. DMCs WILL NOT WORK OTHERWISE")
end


if modify_mfs
    params = mfs(3).Parameters;
    
    % Lekkie przesunięcie środka c w prawo
    delta_c = 10;
    params(3) = params(3) + delta_c;
    mfs(3).Parameters = params;
end


N = 130;
Nu = 30;
lambda = 1;
u_max = F1max;

Mps = zeros(N, D-1, num_local);
Mpzs = zeros(N, Dz, num_local);
K1s = zeros(1, N, num_local);
figure(80); %[output:9471d92b]
hold on; %[output:9471d92b]
figure(100); %[output:62c1cacb]
hold on; %[output:62c1cacb]
for i = 1:num_local
    [S, Sz] = step_resp(h1bars(i), h2bars(i), F1bars(i), Fdbars(i), Ts, k_tau, C1, C2, alpha1, alpha2); 
    figure(80);
    stairs(S, 'DisplayName', ['Local ', num2str(i)]); %[output:9471d92b]
    figure(100);
    stairs(Sz, 'DisplayName', ['Local ', num2str(i)]); %[output:62c1cacb]
    M = zeros(N, Nu);
    Mp = zeros(N, D-1);
    Mpz = zeros(N, Dz);
    for row = 1:N
        for col = 1:Nu
            if row >= col
                M(row, col) = S(row - col + 1);
            end
        end
    end
    for row = 1:N
        for col = 1:D-1
            if row + col <= D
                Mp(row, col) = S(row + col) - S(col);
            else
                Mp(row, col) = S(D) - S(col);
            end
        end
    end
    for row = 1:N
        for col = 1:Dz
            if row + col <= Dz
                Mpz(row, col) = Sz(row + col) - Sz(col);
            else
                Mpz(row, col) = Sz(Dz) - Sz(col);
            end
        end
    end
    K = ( (M'*M + lambda*eye(Nu)) \ M' );
    K1 = K(1, :);
    K1s(:, :, i) = K1;
    Mps(:, :, i) = Mp;
    Mpzs(:, :, i) = Mpz;
end

if test_feedforward
    fig_folder = fullfile('wykresy', 'task_4');
    if ~exist(fig_folder, 'dir')
        mkdir(fig_folder);
    end
end
fig_folder %[output:942ef83c]
figure(80);
grid on; xlabel('t [s]'); ylabel('h2 [cm]'); %[output:9471d92b]
legend('Location','best'); title('Odpowiedzi skokowe modeli lokalnych - tor sterowania'); %[output:9471d92b]
exportgraphics(gcf, fullfile(fig_folder, 'h2_step_u.pdf'), 'ContentType', 'vector'); %[output:9471d92b]
hold off; %[output:9471d92b]
figure(100);
grid on; xlabel('t [s]'); ylabel('h2 [cm]'); %[output:62c1cacb]
legend('Location','best'); title('Odpowiedzi skokowe modeli lokalnych - tor zakłócenia'); %[output:62c1cacb]
exportgraphics(gcf, fullfile(fig_folder, 'h2_step_z.pdf'), 'ContentType', 'vector'); %[output:62c1cacb]
hold off; %[output:62c1cacb]

%[text] Symulacja rozmytego regulatora DMC
Tsim = 400000;
kk_dmc_fuzzy = floor(Tsim/Ts) %[output:4dc714d0]

u_dmc = ones(1,kk_dmc_fuzzy)*F1pp;
h2_dmc = ones(1, kk_dmc_fuzzy)*h2pp;
h1_dmc = ones(1, kk_dmc_fuzzy)*h1pp;
z_dmc = ones(1, kk_dmc_fuzzy)*Fdpp;

dUp = zeros(D-1, 1);
dZp = zeros(Dz, 1);

yzad = ones(1, kk_dmc_fuzzy)*h2pp;

if ~test_feedforward
    yzad(k_tau+2:kk_dmc_fuzzy) = h2max;
    yzad(floor(kk_dmc_fuzzy/3):kk_dmc_fuzzy) = h2min*1.5;
    yzad(floor(kk_dmc_fuzzy/2):kk_dmc_fuzzy) = h2max/1.5;
    yzad(floor(3*kk_dmc_fuzzy/4):kk_dmc_fuzzy) = h2pp;
else
    yzad(floor(kk_dmc_fuzzy/3):kk_dmc_fuzzy) = h2pp/1.1;
    z_dmc(floor(kk_dmc_fuzzy/2):kk_dmc_fuzzy) = Fdpp/2;
end


eps = 0.001;
for k = k_tau+2:kk_dmc_fuzzy
    
    h1_dmc(k-1) = max(h1_dmc(k-1), eps);
    h1_dmc(k) = h1_dmc(k-1) + Ts * (1/(2*C1*h1_dmc(k-1))) * ...
            (u_dmc(k-1-k_tau) + z_dmc(k-1) - alpha1*sqrt(h1_dmc(k-1)));
    h1_dmc(k) = max(h1_dmc(k), 0);
    h2_dmc(k) = h2_dmc(k-1) + Ts * (1/(3*C2*(h2_dmc(k-1))^2)) * ...
            (alpha1*sqrt(h1_dmc(k-1)) - alpha2*sqrt(h2_dmc(k-1)));
    
    h2_dmc(k) = max(h2_dmc(k), 0);

    delta_u = 0;
    mu = evalmf(mfs, ~use_u * h2_dmc(k) + use_u * u_dmc(k - 1));

    for i = 1:num_local
        Mp = Mps(:, :, i);
        K1 = K1s(:, :, i);
        Mpz = Mpzs(:, :, i);
        if use_feedforward
            y0 = h2_dmc(k) + Mp*dUp + Mpz*dZp;
        else
            y0 = h2_dmc(k) + Mp*dUp;
        end
        e = yzad(k)*ones(N,1) - y0;
        du_loc = K1 * e;
        delta_u = delta_u + mu(i)*du_loc;
    end
    % Wyliczanie sygnału sterującego
    
    if u_dmc(k-1)+delta_u < 0
        delta_u = -u_dmc(k-1);
    end
    if u_dmc(k-1)+delta_u > u_max
        delta_u = u_max - u_dmc(k-1);
    end
    u_dmc(k) = u_dmc(k-1) + delta_u;

    dz = z_dmc(k) - z_dmc(k-1); 
    
    % Aktualizacja wektorów zmian zakłóceń i sterowania
    dUp = [delta_u; dUp(1:end-1)];
    dZp = [dz; dZp(1:end-1)];
end

e = yzad-h2_dmc;
RMSE_dmc = sqrt(mean(e.^2));
disp(RMSE_dmc) %[output:6e54ec26]


figure; %[output:4d26bef8]
stairs(h2_dmc, 'DisplayName', 'Wyjście modelu - rozmyty DMC'); %[output:4d26bef8]
hold on; %[output:4d26bef8]
stairs(yzad, '--', 'DisplayName', 'wartość Zadana'); %[output:4d26bef8]
grid on; xlabel('k'); ylabel('h [cm]'); %[output:4d26bef8]
legend('Location','best'); title('Sygnał wyjściowy dla rozmytego algorytmu DMC (Podejście PDC)'); %[output:4d26bef8]
exportgraphics(gcf, fullfile(fig_folder, 'task_2_dmc_y.pdf'), 'ContentType', 'vector'); %[output:4d26bef8]
figure; %[output:882f91fd]
stairs(u_dmc, 'DisplayName', 'Sygnał sterowania'); %[output:882f91fd]
grid on; xlabel('k'); ylabel('u'); %[output:882f91fd]
legend('Location','best'); title('Sygnał sterowania dla rozmytego algorytmu DMC (podejście PDC)'); %[output:882f91fd]
exportgraphics(gcf, fullfile(fig_folder, 'task_2_dmc_u.pdf'), 'ContentType', 'vector'); %[output:882f91fd]
if test_feedforward
    figure;
    stairs(z_dmc, 'DisplayName', 'Sygnał zakłócenia');
    grid on; xlabel('k'); ylabel('u');
    legend('Location','best'); title('Sygnał zakłócenia dla rozmytego algorytmu DMC (podejście PDC)');
    exportgraphics(gcf, fullfile(fig_folder, 'task_2_dmc_z.pdf'), 'ContentType', 'vector');
end


